    false,nt"url": null,nt"notes": "To determine the relative needs of the
    U.S. Fish and Wildlife Service, the Federal Highway Administration (FHWA) was asked
    to inventory all public access roads and parking lots and provide a condition assessment
    of each.  In 2008 the inventory was expanded to include administrative (service
    use only) roads and parking lots. An FHWA representative meets with refuge personnel
    to identify route segments and assign route numbers and functional classifications
    (See Appendix) for each route. All roads and parking lots are mapped using Trimble
    GPS units and visually assessed for condition using the RSL method of evaluation
    developed at Utah State University (See Appendix). Culverts, Gates, Guardrails and
    Low Water Crossings are also mapped and inspected for any obvious defects.",nt"license_title":
